Witam mam do sprzedania samochód osobowy marki Smart Fortwo wyprodukowany w 2006 roku, który został wyposażony w silnik benzynowy o pojemności 698 cm3, legitymujący się mocą 50 KM, który pokonał do tej pory 201000 km. Samochód pod względem mechanicznym w dobrym stanie, silnik odpala bez problemów ciepły czy zimny, skrzynia biegów pracuje bez zarzutu, zawieszenie pracuje prawidłowo, cicho wybiera nierówności, układ kierowniczy jest precyzyjny. Wizualnie Smart prezentuje się jak na zdjęciach dodam, że pojazd jest używany i posiada normalne ślady wynikające z wieku i eksploatacji. Wnętrze pojazdu prezentuje się dobrze, jest czyste i zadbane.



Smart jest wyposażenia w:

- Elektryczne szyby przednie;

- ABS z ESP;

- Centralny zamek;

- 2 x airbag;

I wiele innych rzeczy o których zapomniałem wspomnieć.



Zapraszam wszystkie zainteresowane osoby do kontaktu telefonicznego w celu umówienia się na oględziny i zakupu pojazdu.



OC ważne do 17.09.2025 roku.

Przegląd techniczny 07.03.2026 roku.

Witam, 



Mam do sprzedania auto Citroen C4 Picasso w bogatej wersji Exclusive, wyposażony w niezawodny silnik 2.0 HDi, który doskonale sprawdza się zarówno w warunkach miejskich, jak i podczas dłuższych tras. Przebieg samochodu to 329 000 km.



Samochód ma ważne ubezpieczenie OC do 05.2026 i wymieniony rozrząd.



Wnętrze to ciemna tapicerka, wyjątkowo praktyczna z punktu widzenia dzieci. 



Wyposażenie pojazdu obejmuje m.in.:



-sprawną klimatyzację automatyczną wielostrefową;

-oryginalne radio;

-dobrej jakości nagłośnienie;

-elektryczne szyby;

-elektryczne lusterka;

-zamek centralny;

-ESP;

-ABS;

-koło zapasowe;

-elektryczny hamulec ręczny;

-automatyczną skrzynię biegów;

-klimatyzowany schowek;

- za dopłatą, zestaw opon zimowych na stalowych felgach + możliwość zakupu relingów dachowych.



Auto wymaga drobnych poprawek lakierniczych w obszarze nadproży.

Dzień dobrym, mam do sprzedania samochód osobowy marki Renault Kangoo wyprodukowany w 2004 roku, który został wyposażony w silnik wysokoprężny turbodoładowany o pojemności 1461 cm3, legitymujący się mocą 82 KM, który pokonał do tej pory 265000 km. Samochód pod względem mechanicznym w dobrym stanie, silnik odpala bez problemów ciepły czy zimny, skrzynia biegów pracuje bez zarzutu, lecz sprzegło się ślizga, zawieszenie pracuje prawidłowo, cicho wybiera nierówności, układ kierowniczy jest precyzyjny. Wizualnie Renault prezentuje się jak na zdjęciach dodam, że pojazd jest używany i posiada normalne ślady wynikające z wieku i eksploatacji. Wnętrze pojazdu prezentuje się bardzo dobrze, jest czyste, zadbane, klimatyzacja do przejrzenia, bardzo słabo chłodzi.



Kangoo jest wyposażenia w:

- Klimatyzację;

- ABS;

- Alufelgi;

- Centralny zamek;

- Elektryczne szyby przednie;

- Elektryczne lusterka;

- 2 x airbag;

I wiele innych rzeczy o których zapomniałem wspomnieć.



Zapraszam wszystkie zainteresowane osoby do kontaktu telefonicznego w celu uzyskania większej ilości informacji. 



Samochód do obejrzenia w Łodzi po wcześniejszym umówieniu się.



OC ważne do 09.11.2025 roku.

Przegląd techniczny 04.11.2025 roku.
